script: |
  super -f text -I q4333.spq | sort > q4333.out

inputs:
  - name: q4333.spq
    data: |
      SELECT - col1 AS col0 FROM tab0 (FORMAT parquet) WHERE + col2 / + 21 * - + col1 + + 55 * - col2 IS NOT NULL;
  - name: tab0

outputs:
  - name: q4333.out
    data: |
      -1
      -21
      -81
